webpackJsonp([1159],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-stringprototypesplit.json":function(t,e){t.exports={data:{markdownRemark:{html:'<p>The split() method splits a string into an array of strings.</p>\n<p><strong>Syntax</strong></p>\n<pre><code>str.split(separator[, limit]);\n</code></pre>\n<h2>Parameters</h2>\n<p><strong>separator</strong> Optional. The separator specifies which characters to use for separating the string. If separator is omitted <code>str.split();</code> the array will contain just one element consisting of the entire string. If separator is an empty string <code>str.split("");</code> the string is converted into an array of characters.</p>\n<p><strong>limit</strong> Optional. Whole number integer that sets a limit to the number of splits that can be found. The <code>split()</code> method will still find all of the matches to the separator, but will truncate the returned array to a maximum length of <code>limit</code> elements.</p>\n<h2>Description</h2>\n<p>The split() method returns the new array.</p>\n<p>At each match of the separator <code>.split()</code> will split the string and add the split section as an element to an array.</p>\n<h2>Examples</h2>\n<p><strong>Splitting a string into an array of substrings</strong></p>\n<pre><code>var str = "HelloWorld";\nconsole.log(str.split(""));\n// Console will output: ["H", "e", "l", "l", "o", "W", "o", "r", "l", "d"]\n\nvar str2 = "HelloWorld";\nconsole.log(str2.split());\n// Console will output: ["Hello World"]\n\nvar str3 = "HelloWorld";\nconsole.log(str3.split("Wo"));\n// Console will output: ["Hello", "rld"]\n</code></pre>\n<p>Source <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/split">MDN</a></p>',frontmatter:{title:"javaScript Stringprototypesplit",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-stringprototypesplit/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-stringprototypesplit/"}}}});
